import React from 'react'
import {
    SigninContainer,
    SigninFormContainer,
    Form,
    FormLabels,
    FormsInputs
}
from './SigninElements';

const Signin = () => {
    return (
        <SigninContainer>
            <SigninFormContainer>
                <Form>
                    <FormLabels></FormLabels>
                    <FormInputs></FormInputs>
                </Form>
            </SigninFormContainer>
        </SigninContainer>
    )
}

export default Signin;
